import random

nucleotides = ["A", "C", "G", "T"]

DNAsample = ""

def countFrequency(dna):
  tmpFreqDict = {"A": 0, "C": 0, "G": 0, "T": 0}
  for nuc in dna:
    tmpFreqDict[nuc] +=1
  return tmpFreqDict

result = countFrequency(DNAsample) 
print(' '.join([str(val) for key, val in result.items()]))

